import React,{useState,useEffect} from 'react';

function Test() {
  const vocab = () => {
      fetch('http://localhost/PWA-tutorial-training/learn-chinese/backend/index.php?lesson=flash')
  }
  return (
    <div className="App">
        chuck testa
        {vocab.map((word) => (
            <div className="word">{word}</div>
        ))}
    </div>
  );
}

export default Test;
